B.acF=new A.e5("In welcher Schlafphase entstehen Klartr\xe4ume?","\xdcberwiegend in der REM-Phase (bildhafte Tr\xe4ume, schnelle Augenbewegungen). Im Labor werden h\xe4ufig Augensignale genutzt, um Klarheit im REM zu markieren.")
B.acK=new A.e5("Woran erkenne ich, dass ich gerade klar tr\xe4ume?","Schl\xfcsselsignal ist die Einsicht \u201eIch tr\xe4ume\u201c. Farben und Details wirken oft intensiver; du erinnerst dich an dein Ziel und kannst Verhalten bewusster steuern.")
B.acC=new A.e5("Ist Klartr\xe4umen gef\xe4hrlich?","F\xfcr Gesunde gilt es als sicher. Vermeide jedoch chronische Schlafverk\xfcrzung. Bei psychischen Erkrankungen oder schweren Parasomnien vorab fachlich abkl\xe4ren.")
B.acN=new A.e5("Hilft Klartr\xe4umen bei Albtr\xe4umen?","Ja, teils: Klarheit erm\xf6glicht Umdeutung oder aktive Konfrontation. F\xfcr klinische Anwendung (z. B. IRT) ist therapeutische Begleitung sinnvoll.")
B.acD=new A.e5("Brauche ich besondere Begabung?","Nein. Traumtagebuch, Reality-Checks und gezielte Intentionen reichen, um die Wahrscheinlichkeit deutlich zu erh\xf6hen.")
B.acU=new A.e5("Wie lange dauert es bis zum ersten Klartraum?","Sehr unterschiedlich: von Tagen bis Wochen. Gute Start-Kombi: Schlafhygiene + Tagebuch + Reality-Checks + WBTB + MILD.")
B.acM=new A.e5("Was ist ein Reality-Check?","Ein kurzer Test, ob du tr\xe4umst (z. B. Text zweimal lesen, Nase zuhalten und atmen). Regelm\xe4\xdfig im Alltag trainieren, damit er im Traum automatisch ausgel\xf6st wird.")
B.acL=new A.e5("Welche Einsteiger-Techniken sind sinnvoll?","MILD (Intention), SSILD (Aufmerksamkeitszyklen), WBTB (Wecken & wieder Einschlafen), und DILD (Klarheit im Traum durch Checks).")
B.acR=new A.e5("Was ist WILD?","Wake-Initiated Lucid Dream: Du gleitest wach in den Traum. Anspruchsvoller; besser, nachdem du mit DILD/MILD erste Erfolge hast.")
B.acQ=new A.e5("Wie f\xfchre ich ein Traumtagebuch richtig?","Direkt nach dem Aufwachen stichwortartig festhalten: Personen, Orte, Gef\xfchle, Unstimmigkeiten. T\xe4glich \u2192 bessere Erinnerung & mehr Klartr\xe4ume.")
B.acS=new A.e5("Welche Rolle spielt Schlafhygiene?","Gro\xdf. Konstanz bei Schlafzeiten, k\xfchles dunkles Zimmer, Licht abends reduzieren, Koffein sp\xe4t meiden \u2013 alles verbessert REM-Qualit\xe4t.")
B.acP=new A.e5("Was bringt der RC-Reminder?","Kontextbasierte Erinnerungen (z. B. Standort, Uhrzeit, Aktivit\xe4t) helfen, Reality-Checks regelm\xe4\xdfig und sinnvoll im Alltag zu verankern.")
B.acV=new A.e5("Was ist Night Lite+?","Sanfte akustische/visuelle Cues in wahrscheinlichen REM-Phasen, die du vor dem Schlafen mit einer Intention verkn\xfcpfst (Klarheit ohne Aufwecken).")
B.acH=new A.e5("Wie vermeide ich Aufwachen, wenn ich klar bin?","Ruhe bewahren, Traum stabilisieren (H\xe4nde reiben, Details ansehen), Ziel fokussieren, starke Emotionen drosseln.")
B.acT=new A.e5("Was mache ich bei Schlafparalyse?","Bleib ruhig, konzentriere dich auf Atmung und kleine Bewegungen (Finger/Zehen). Sie ist unangenehm, aber nicht gef\xe4hrlich und vergeht nach Sekunden.")
B.acG=new A.e5("Kann ich im Klartraum \xfcben/lernen?","Ja, mentale Proben k\xf6nnen Bewegungsabl\xe4ufe und Selbstvertrauen verbessern. Erwartungen realistisch halten und regelm\xe4\xdfig reflektieren.")
B.acE=new A.e5("Ist Technik/Wearable n\xf6tig?","Nicht n\xf6tig, aber hilfreich: Schlaf-Tracking, sanfte Cues, Journal-Erfassung. Die Basis bleibt Verhalten & Konsistenz.")
B.acI=new A.e5("Worauf sollte ich bei Sicherheit achten?","Gesund schlafen (keine dauerhafte Verk\xfcrzung), Stress reduzieren, bei psychischen Problemen erst R\xfccksprache halten, realistische Ziele setzen.")
